      <nav>
      {/* Desktop Nav */}
      <ul className='flex'>
        <li><a href='/#about'>About</a></li>
        <li><a href='/#projects'>Projects</a></li>
        <li><a href='/#blog'>Blog</a></li>
        <li><a href='/#contacts'>Contacts</a></li>
